import React, { Component } from 'react'
import axios from 'axios'

class Profile extends Component {
  constructor(props) {
    super(props)
    this.state = {
      name: '',
      email: '',
      date: '',
    }
  }

  componentDidMount() {
    axios
      .get('/users/' + this.props.match.params.id)
      .then((response) => {
        this.setState({
          users: response.data,
        })
      })
      .catch((error) => {
        console.log(error)
      })
  }

  render() {
    return (
      <div>
        <h1>Profile</h1>
        <p>{this.props.user.name}</p>
      </div>
    )
  }
}

export default Profile
